import Link from 'next/link';
import fetch from 'isomorphic-unfetch';

const Rockets = ({ rockets }) => {
  console.log('ROCKETS', rockets);
  return (
    <div>
      <h1>Rockets Data</h1>
      <Link href='/'>
        <button>Home</button>
      </Link>
      <div>
        {rockets && rockets.map(rocket => {
          <div key={rocket.id} style={{color: 'red', fontSize: '14px'}}>
            <Link href={`rockets/${rocket.id}`}>
              <a>{rocket.name}</a>
            </Link>            
            {rocket.description}
            ROCKETS
          </div>
        })}
        <h2>{rockets[0].company}</h2>
        <img src={rockets[0].flickr_images[0]} alt='rockets'></img>
      </div>
    </div>
  )
}

export async function getStaticProps(context) {
  const res = await fetch('https://api.spacexdata.com/v3/rockets?limit=10');
  const data = await res.json();
  console.log('DATA', data);
  return {
    props: {
      rockets: data
    }
  }
}

export default Rockets;
